import React, { Component } from 'react'
import axios from 'axios';
export class PostList extends Component {
    constructor(props) {
        super(props)

        this.state = {
             posts : [] ,
             products: [{id: 1, title: 'Test', body: '123'}],

             error : ' '
        }
    }
    componentDidMount(){
        axios.get(`https://jsonplaceholder.typicode.com/users`)
      .then(res => {
        const persons = res.data;
        this.setState({ persons });
      })

    }
    renderProducts() {
        return this.state.persons.map(product => {
          return (
            <tr key={product.id}>
              <td>{product.id}</td>
              <td>{product.title}</td>
              <td>{product.body}</td>
            </tr>
          );
        })
      }

    render() {
        const {posts, errorMsg}= this.state
        return (
            <div>
        {this.renderProducts()}

            </div>
        )
    }
}

export default PostList
